Here is a simple example of how you can achieve this:

First, create a new file `tooltipContext.js` and add the following code:
```js
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```
This code creates a new context `TooltipContext` and a provider `TooltipProvider` that wraps the children components. The provider has a state `tooltip` that stores the currently opened tooltip and a function `closeTooltip` that sets the state to `null` when called.

Next, create a new file `tooltip.js` and add the following code:
```js
import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  const handleClick = () => {
    if (tooltip) {
      closeTooltip();
    } else {
      setTooltip(text);
    }
  };

  return (
    <div
      onMouseEnter={() => {
        if (!tooltip) {
          setTooltip(text);
        }
      }}
      onMouseLeave={closeTooltip}
      onClick={handleClick}
    >
      {children}
      {tooltip && (
        <div className="tooltip">
          <p>{text}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
This code creates a `Tooltip` component that uses the `useContext` hook to get the `tooltip` state and the `closeTooltip` function from the context. The component has a `handleClick` function that sets the `tooltip` state to the text when the component is clicked and closes the tooltip when it's already open. The component also has an `onMouseEnter` event handler that sets the `tooltip` state to the text when the mouse enters the component and an `onMouseLeave` event handler that closes the tooltip when the mouse leaves the component.

Finally, wrap your app with the `TooltipProvider` component and use the `Tooltip` component wherever you need it:
```js
import React from 'react';
import { render } from 'react-dom';
import { TooltipProvider } from './tooltipContext';
import Tooltip from './tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip text="Hello World!">Hover me</Tooltip>
        <Tooltip text="This is another tooltip">Hover me again</Tooltip>
      </div>
    </TooltipProvider>
  );
};

render(<App />, document.getElementById('root'));
```
This code wraps the app with the `TooltipProvider` component and uses the `Tooltip` component twice with different texts. When you hover over the components, the tooltips will appear and disappear correctly.

